import { useEffect } from 'react';
import './App.css';
import axios from './config/axios';
import Toaster from './helper/Toaster';

function App() {

  const checkapi = async () => {
    await axios.get('/').then(({ data }) => {
      Toaster("Toaster is running", "success")
      console.log(data)
    }).catch((error) => {
      Toaster(error.toString(), "error")
    })
  }

  useEffect(() => {
    checkapi()
  }, [])


  return (
    <>
      UI started
    </>
  );
}

export default App;
